import React from 'react'
import Layout from '../components/Layout'

function Index(props){
  const {message} = props;
  return (
    <Layout title="Home">
      <div>
        welcome {props.message}
      </div>
    </Layout>
  )
}

export async function getStaticProps(context){
  return{
    props:{
      message: `next.js1!`
    }
  };
}
export default Index;
